import React, { useEffect } from 'react';
import { useState } from 'react';
import axios from 'axios';
function Chatpage() {
    const [chats, setChats] = useState([]);
    const fetchChats = async () =>{
        const {data} = await axios.get('/api/chat');
        setChats(data);
    };
    useEffect(() =>{
        fetchChats();
    }, []);
  return (
    <div>{chats.map((chat)=>(
        <div>
            {chat.chatName}
        </div>
    ))}
    </div>
  )
}

export default Chatpage;
